import { jsPDF } from "jspdf";
var font =
  "";
var callAddFont = function () {
  this.addFileToVFS("Inter-normal.ttf", font);
  this.addFont("Inter-normal.ttf", "Inter-TTF", "normal");
  this.addFont("Inter-normal.ttf", "Inter-TTF", "bold");
  this.addFont("Inter-normal.ttf", "Inter-TTF", "italic");
  this.addFont("Inter-normal.ttf", "Inter-TTF", "bolditalic");
};
jsPDF.API.events.push(["addFonts", callAddFont]);
